document.getElementsByTagName('title')[0].innerHTML="Details";function goFeadback(){try{client;var i=client.getDeviceInfo();var oi=JSON.parse(i);if(oi.app_id=='com.lenovo.anyshare'&&parseInt(oi.app_ver)>=4030138){client.handleAction("help To Feedback",8,"15")}}catch(e){$('feadback_btn').removeAttribute("onclick");$('feadback_btn').setAttribute("href","https://www.facebook.com/bestSHAREit");console.log(e)}}function collect(e,bl){var hr=window.location.href;var arr=hr.split('/');var filename=arr[arr.length-1];var idarr=filename.split('.');var pid=idarr[0];if(e=='btn_1'){$('btn_1').className="btn "+'click';$('btn_2').className="btn "+'unclick';$('btn_2').removeAttribute("onclick")}else{$('btn_2').className="btn "+'click';$('btn_1').className="btn "+'unclick';$('btn_1').removeAttribute("onclick")}try{client;if(bl==true){client.analyticsEvent('UF_WHUseful',pid)}else if(bl==false){client.analyticsEvent('UF_WHNoUseful',pid)}}catch(e){console.log(e)}}function $(id){return document.getElementById(id)}